import React from 'react';
import { render, screen } from '@testing-library/react';
import App from './App';

test('Calculator', () => {
  render(<App />);
  const test = screen.getByText(/1/i);
  expect(test).toBeInTheDocument();
  const failedTests = process.exitCode;

  if (failedTests === 0) {
    console.log('Unit test successful');
  } else {
    console.log('Unit test failed');
  }
  console.log('why');
});
